import React from 'react';

class Welcome extends React.Component {
  render() {
    return <h1>Hello, {this.props.name}</h1>;
  }
}

const element1 = <h1>Hello, world</h1>;
const element2 = <Welcome name="Simon"/>;
function App() {

  return (
    element1,
    element2
  )
} 

export default App;
